import React from "react";

import Contact from "./Contact";

const ContactList = (props) => 
{
    return (
        <div>
            {props.contacts.map(c => < Contact key = {c._id} name ={c.name} />)}
            {props.contacts.map(c => < Contact key = {c._id} ProfilePic ={c.ProfilePic} />)}
        </div>
    );
};
export default ContactList;
